/*Table structure for table `subjects` */

DROP TABLE IF EXISTS `subjects`;

CREATE TABLE `subjects` (
  `id` char(8) NOT NULL,
  `department_id` char(2) DEFAULT NULL,
  `year_level_id` varchar(2) DEFAULT NULL,
  `name` varchar(100) DEFAULT NULL,
